import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Main from "./layouts/Main";


const App = () => {
  return (
    <>
      <Router>
        <Switch>
          <Route path="/pizza">
            <Main />
          </Route>

          <Route path="/" exact>
            <Home />
          </Route>
        </Switch>
      </Router>


    </>
  );
};
export default App;
